import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

import { getSessionItem } from 'utils/storage';
import { default as EgovLeftNav } from 'components/leftmenu/EgovLeftNavLicense';

function EgovIntroWork() {
    const sessionUser = getSessionItem('loginUser');
    const sessionUserId = sessionUser?.id;
    const sessionUserName = sessionUser?.name;
    const sessionUserSe = sessionUser?.userSe;

    const navigate = useNavigate();

    useEffect(() => {
        if (!sessionUserId) {
            alert('로그인이 필요한 서비스입니다.');
            navigate('/login');
        }
    }, [sessionUserId, navigate]);

    return (
        <div className="container">
            <div className="c_wrap">
                {/* <!-- Location --> */}
                <div className="location">
                    <ul>
                        <li><a className="home" href="#!">Home</a></li>
                        <li><a href="#!">운전면허시험</a></li>
                        <li>운전면허시험 결과 확인</li>
                    </ul>
                </div>
                {/* <!--// Location --> */}

                <div className="layout">
                    {/* <!-- Navigation --> */}
                    <EgovLeftNav></EgovLeftNav>
                    {/* <!--// Navigation --> */}

                    <div className="contents BUSINESS_INTRO" id="contents">
                        {/* <!-- 본문 --> */}

                        <h1 className="tit_3">운전면허시험</h1>

                        <p className="txt_1"></p>

                        <h2 className="tit_4">운전면허시험 결과 확인</h2>

                        <h3 className="tit_5">개요</h3>

                        <div className="board_list BRD009">
                            <div className="head">
                                <span>번호</span>
                                <span>게시판명</span>
                                <span>사용 커뮤니티명</span>
                                <span>사용 동호회명</span>
                                <span>등록일시</span>
                                <span>사용여부</span>
                            </div>

                        </div>

                        {/* <!--// 본문 --> */}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default EgovIntroWork;
